text:
&lt;

Selama ini kebutuhan yang ia terima berasal dari antek-antek ayahnya, atau mungkin para pegawai yang cari muka pada anak angkat kesayangan Isaach yang mulia. Hidup mandiri begini cukup menyulitkan dirinya.

&gt;'

translated_text:
&lt;

So far, the needs he has received have come from his father's lackeys, or perhaps employees who were looking for favors with the noble Isaach's beloved adopted son. Living independently like this is quite difficult for him.

&gt;'

back_translated_text:
&lt;

Selama ini kebutuhan yang ia terima berasal dari antek-antek ayahnya, atau mungkin para pegawai yang sedang mencari bantuan dari anak angkat kesayangan sang bangsawan Isaach. Hidup mandiri seperti ini cukup sulit baginya.

&gt;'
